Dutch:
Frank Moses en zijn team van voormalige CIA-agenten zullen hun krachten wederom moeten bundelen, om, toerend door Europa, hun vijanden uit te schakelen. Frank en de andere agenten zijn op zoek naar een massavernietigingswapen. Maar allereerst moeten zij de man die het wapen heeft ontworpen, bevrijden uit een psychiatrische inrichting...

English:
Retired C.I.A. agent Frank Moses reunites his unlikely team of elite operatives for a global quest to track down a missing portable nuclear device. 

